// import $ from "jquery";

function clickTesteo(state) {

	console.log( `clicktesteo` );

	var cars = {
		"aa" : "Saab" ,
		"bb" : "Volvo" ,
		"cc" : "BMW" ,
	}
	
	console.log( typeof JSON.stringify( cars ) );
	console.log( cars );
	state(cars)
	
};

export { clickTesteo }
